import base64


class SensitiveInforRM:
    class F:
        def __init__(self, f, g):
            self.e = {}
            self.f = f
            self.g = g

    def __init__(self):
        self.q = []
        t = 0
        s = ''
        z = base64.b64decode(s.encode('utf-8'))
        s = []
        for q in z:
            t = (t << 7) | (q & 127)
            if q & 128:
                s.append(t)
                t = 0
        while t < len(s):
            f = SensitiveInforRM.F(s[t + 1] - 1, s[t] == 0)
            w = s[t]
            for j in range(w):
                t += 2
                f.e[s[t]] = s[t + 1]
            self.q.append(f)
            t += 2

    def is_security(self, s: str) -> bool:
        t = 0
        for z in str.encode(s, "utf-8"):
            z ^= 219
            while t != -1 and z not in self.q[t].e:
                t = self.q[t].f
            if t == -1:
                t = 0
                continue
            t = self.q[t].e[z]
            if self.q[t].g:
                return False
        return True
